import useReactRouter from 'use-react-router';
import Header from './header';
import HeaderChat from './headerChat';
import { Typography, makeStyles, Grid, Box, Button, ListItemAvatar, Avatar, List } from '@material-ui/core'
import classes from '*.module.css'
const scenarioLeft = require('../assets/scenarioLeft.png');
const scenarioRight = require('../assets/scenarioRight.png');
const useStyles = makeStyles((theme) => ({
    leftWing: {
        position: "absolute",
        top: "10%",
        left: "10%"


    },
    rightWing: {
        position: "absolute",
        top: "10%",
        right: "10%"
    },
    textArea: {
        position: "absolute",
        width: "100%",
        // backgroundColor: "#EFEDE9",
        top: "20%",
        bottom: "25%",
        // overflow: "auto",
        textAlign: "center",
    },
    textProp: {
        left:"15%",
        color: "#4575B4",
        fontSize: 20,
        position: "absolute",
        fontFamily: 'Hira Min Pro',
        textAlign: "center",
        letterSpacing: "6px",
        lineHeight: "40px",
    }

}))
const Summary: React.FC = () => {
    const { history } = useReactRouter();
    const classes = useStyles();
    return (
        <div>
            <HeaderChat title="サマリ画面" />
            <div className={classes.textArea}>

                <img className={classes.leftWing} src={scenarioLeft} />
                <div className={classes.textProp}>

                    <p>あなたがたどったシナリオは</p>
                    <p>結婚シナリオ</p>
                </div>
                <img className={classes.rightWing} src={scenarioRight} />
                <div></div>
            </div>
            <input type="textarea">
            </input>
            <div></div>
            <button onClick={() => history.push("/welcome")}>旅行終了</button>
        </div>
    )
}
export default Summary
